import { useState, useMemo, useEffect } from 'react';
import { motion } from 'framer-motion';
import Confetti from 'react-confetti';
import './App.css';

const images = [
  '/images/image0.jpg',
  '/images/image1.jpg',
  '/images/image2.jpg',
  '/images/image3.jpg',
  '/images/image4.jpg',
  '/images/image5.jpg',
  '/images/image6.jpg',
  '/images/image7.jpg',
  '/images/image8.jpg',
  '/images/image9.jpg',
  '/images/image10.jpg',
  '/images/image11.jpg'
];

function App() {
  const [openedGifts, setOpenedGifts] = useState([]);
  const [isPlaying, setIsPlaying] = useState(false);

  const audioRef = useMemo(() => new Audio('/birthday-music.mp3'), []);

  useEffect(() => {
    audioRef.loop = true;
    return () => audioRef.pause();
  }, [audioRef]);

  const toggleMusic = () => {
    if (isPlaying) {
      audioRef.pause();
    } else {
      audioRef.play();
    }
    setIsPlaying(!isPlaying);
  };

  const openGift = (index) => {
    if (!openedGifts.includes(index)) {
      setOpenedGifts([...openedGifts, index]);
    }
  };

  const particles = useMemo(() => 
    Array.from({ length: 20 }, (_, i) => ({
      id: i,
      x: Math.random() * window.innerWidth,
      y: window.innerHeight + 50,
      duration: Math.random() * 5 + 10,
      type: i % 4 === 0 ? 'balloon' : i % 3 === 0 ? 'star' : i % 2 === 0 ? 'heart' : 'gift'
    })), []
  );

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-200 to-pink-200 relative overflow-hidden p-4">
      {particles.map(p => (
        <motion.div
          key={p.id}
          className="absolute text-4xl"
          style={{ left: p.x }}
          initial={{ y: p.y, opacity: 0 }}
          animate={{ 
            y: -window.innerHeight - 50, 
            rotate: Math.random() * 360 - 180,
            opacity: [0, 1, 0]
          }}
          transition={{
            duration: p.duration,
            repeat: Infinity,
            ease: "linear",
            delay: Math.random() * 2
          }}
        >
          {p.type === 'balloon' ? 'üéà' : p.type === 'star' ? '‚≠ê' : p.type === 'heart' ? '‚ù§Ô∏è' : 'üéÅ'}
        </motion.div>
      ))}

      <motion.div 
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 1, type: 'spring' }}
        className="flex flex-col items-center text-center"
      >
        <h1 className="text-5xl font-bold text-pink-600 mb-2">Happy First Birthday Atharva!</h1>
        <p className="text-2xl text-blue-800 mb-8">Born on January 2, 2025 üéâ</p>

        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8">
          {images.map((src, index) => (
            <motion.div
              key={index}
              initial={{ scale: 0.8, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              transition={{ delay: index * 0.1, type: 'spring', stiffness: 120 }}
              className="relative"
            >
              <div 
                className={`present-box ${openedGifts.includes(index) ? 'open' : ''}`} 
                onClick={() => openGift(index)}
              >
                <div className="present">
                  <div className="img-wrap">
                    <img src={process.env.PUBLIC_URL + src} alt={`Atharva's Memory ${index + 1}`} />
                  </div>
                </div>
                <div className="side front"></div>
                <div className="side back"></div>
                <div className="side left"></div>
                <div className="side right"></div>
                <div className="side top">
                  <span className="to">
                    <span className="name">Gift {index + 1}</span>
                  </span>
                </div>
                <div className="side bottom"></div>
              </div>
              {!openedGifts.includes(index) && (
                <p className="text-center text-sm text-gray-600 mt-2">Click to Open!</p>
              )}
            </motion.div>
          ))}
        </div>
      </motion.div>

      {/* Music Player Button */}
      <motion.button
        whileHover={{ scale: 1.2 }}
        whileTap={{ scale: 0.9 }}
        onClick={toggleMusic}
        className="fixed bottom-8 right-8 bg-pink-500 text-white rounded-full p-6 shadow-2xl text-3xl z-50"
      >
        {isPlaying ? 'üîá' : 'üéµ'}
      </motion.button>

      {openedGifts.length > 0 && <Confetti recycle={false} numberOfPieces={200} />}
    </div>
  );
}

export default App;
